import React from 'react';
import './Game.css'
const Game = (props) => {
    const {name,img,details,age,time}=props.game
    return (
        <div className='element'>
            <img src={img} alt="" />
            <h3>{name}</h3>
            <p>{details}</p>
            <h5>For Age: {age}</h5>
        </div>
    );
};

export default Game;
